B.afA=new A.bm("\ubaa9\uc801: \ub538\uc601\uc5b4 \ud560\uc778 \ud61c\ud0dd, \uc774\ubca4\ud2b8 \uc815\ubcf4, \uc2e0\uaddc \uc11c\ube44\uc2a4 \uc548\ub0b4 \ub4f1 \ub9c8\ucf00\ud305\uc6a9 \uc815\ubcf4 \ubc1c\uc1a1\n\n\ud56d\ubaa9: \uc774\uba54\uc77c \uc8fc\uc18c\n\n\ubcf4\uc720 \ubc0f \uc774\uc6a9 \uae30\uac04: \uc774\uc6a9\uc790\uc758 \ub3d9\uc758 \ucca0\ud68c \uc2dc\uae4c\uc9c0\n                                  ",null,null,null,null,null,null,null,null,null,null)
